import React from "react";
import backgroundVideo from '../visuals/homepage/instructions'
export default function Instructions() {
  return (
    <div>
      <video autoplay muted loop id="myVideo">
        <source src={backgroundVideo} type="video/mp4" />
      </video>
    </div>
  );
}
